import zhMessages from "../locales/zh-Hans.json";

const zh = "输入新密码并进行确认用户名密码或者点击任意按钮未读电子邮件";

const randomNumber = Math.floor(Math.random() * zh.length);

console.log(zh.length);

zhMessages["sidebar.publisher"] = "输入新";

const ZhLan = {
  messages: {
    ...zhMessages,
  },
  antd: null,
  locale: "zh-Hans-CN",
};
export default ZhLan;
